import styled from "styled-components";

export const Container = styled.div`
    text-align: center;
   background-color: gray;
   width: 200px;
   border: 1px solid black;
   box-shadow: 50px 50px pink;
    div {
       img {
           max-width: 150px;
       }
   }
`;
